(1836, 2, 1697073856, 'theme_moove', 'marketingcontent', '<p class=\"MsoNormal\"><span style=\"font-family: Roboto;\">Nuestra Aula Virtual del Centro Nacional de Planeamiento Estrat&eacute;gico es un espacio dedicado a la excelencia en la planificaci&oacute;n estrat&eacute;gica. Aqu&iacute;, ofrecemos recursos, capacitaci&oacute;n y herramientas de calidad para impulsar el desarrollo de estrategias efectivas. Nuestra misi&oacute;n es promover la toma de decisiones informadas y el desarrollo sostenible, proporcionando a profesionales y l&iacute;deres las habilidades necesarias para afrontar los desaf&iacute;os del futuro<o:p></o:p></span></p>', '<p>Moove is a Moodle template based on Boost with modern and creative design.</p>'),
