(1845, 2, 1697077680, 'theme_moove', 'marketing1heading', 'Funciones generales del Ceplan', 'Promover'),
(1846, 2, 1697077681, 'theme_moove', 'marketing1content', '<p>Promover y orientar la formaci&oacute;n, actualizaci&oacute;n profesional y t&eacute;cnica de especialistas en planeamiento estrat&eacute;gico, prospectiva y formulaci&oacute;n y evaluaci&oacute;n de pol&iacute;ticas p&uacute;blica y planes, en los tres niveles de gobierno y en las instituciones de educaci&oacute;n superior. &nbsp; &nbsp;</p>', '<p class=\"MsoNormal\"><span style=\"font-family: Roboto;\">Difundir procesos e informaci&oacute;n actualizada y especializada<o:p></o:p></span></p>'),
(1847, 2, 1697077681, 'theme_moove', 'marketing2heading', 'Objetivo', 'Orientar la formación'),
(1848, 2, 1697077681, 'theme_moove', 'marketing2content', '<p>Difundir procesos e informaci&oacute;n actualizada y especializada sobre la formulaci&oacute;n de la fase de conocimiento integral de la realidad y futuro deseado para los diferentes instrumentos del Sinaplan.</p>', '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod.</p>'),
(1849, 2, 1697077681, 'theme_moove', 'marketing3heading', 'Público objetivo', 'Lorem'),
(1850, 2, 1697077681, 'theme_moove', 'marketing3content', '<p>Funcionarios p&uacute;blicos y operadores del Sinaplan que coordinan u orientan la elaboraci&oacute;n o actualizaci&oacute;n del conocimiento integral de la realidad y futuro deseado a nivel nacional, territorial y local; de pol&iacute;ticas y planes, particularmente aquellas orientadas al largo plazo.&nbsp;</p>', '<p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod.</p>'),
(1851, 2, 1697077896, 'theme_moove', 'marketing1content', '<p>Promover y orientar la formaci&oacute;n, actualizaci&oacute;n profesional y t&eacute;cnica de especialistas en planeamiento estrat&eacute;gico, prospectiva y formulaci&oacute;n y evaluaci&oacute;n de pol&iacute;ticas p&uacute;blica y planes.</p>', '<p>Promover y orientar la formaci&oacute;n, actualizaci&oacute;n profesional y t&eacute;cnica de especialistas en planeamiento estrat&eacute;gico, prospectiva y formulaci&oacute;n y evaluaci&oacute;n de pol&iacute;ticas p&uacute;blica y planes, en los tres niveles de gobierno y en las instituciones de educaci&oacute;n superior. &nbsp; &nbsp;</p>'),
(1852, 2, 1697077896, 'theme_moove', 'marketing3content', '<p>Funcionarios p&uacute;blicos y operadores del Sinaplan que coordinan u orientan la elaboraci&oacute;n o actualizaci&oacute;n del conocimiento integral de la realidad y futuro deseado a nivel nacional, territorial y local.</p>', '<p>Funcionarios p&uacute;blicos y operadores del Sinaplan que coordinan u orientan la elaboraci&oacute;n o actualizaci&oacute;n del conocimiento integral de la realidad y futuro deseado a nivel nacional, territorial y local; de pol&iacute;ticas y planes, particularmente aquellas orientadas al largo plazo.&nbsp;</p>'),
