(1939, 'theme_moove', 'marketingheading', 'Aula Virtual del Ceplan'),
(1940, 'theme_moove', 'marketingcontent', '<p class=\"MsoNormal\"><span style=\"font-family: Roboto;\">Nuestra Aula Virtual del Centro Nacional de Planeamiento Estrat&eacute;gico es un espacio dedicado a la excelencia en la planificaci&oacute;n estrat&eacute;gica. Aqu&iacute;, ofrecemos recursos, capacitaci&oacute;n y herramientas de calidad para impulsar el desarrollo de estrategias efectivas.&nbsp;<o:p></o:p></span></p>'),
(1941, 'theme_moove', 'marketing1icon', '/promover.png'),
(1942, 'theme_moove', 'marketing1heading', 'Funciones generales del Ceplan'),
(1943, 'theme_moove', 'marketing1content', '<p>Promover y orientar la formaci&oacute;n, actualizaci&oacute;n profesional y t&eacute;cnica de especialistas en planeamiento estrat&eacute;gico, prospectiva y formulaci&oacute;n y evaluaci&oacute;n de pol&iacute;ticas p&uacute;blica y planes.</p>'),
(1944, 'theme_moove', 'marketing2icon', '/promover.png'),
(1945, 'theme_moove', 'marketing2heading', 'Objetivo'),
(1946, 'theme_moove', 'marketing2content', '<p>Difundir procesos e informaci&oacute;n actualizada y especializada sobre la formulaci&oacute;n de la fase de conocimiento integral de la realidad y futuro deseado para los diferentes instrumentos del Sinaplan.</p>'),
(1947, 'theme_moove', 'marketing3icon', '/promover.png'),
(1948, 'theme_moove', 'marketing3heading', 'Público objetivo'),
(1949, 'theme_moove', 'marketing3content', '<p>Funcionarios p&uacute;blicos y operadores del Sinaplan que coordinan u orientan la elaboraci&oacute;n o actualizaci&oacute;n del conocimiento integral de la realidad y futuro deseado a nivel nacional, territorial y local.</p>'),
(1950, 'theme_moove', 'marketing4icon', '/promover.png'),
(1951, 'theme_moove', 'marketing4heading', 'Caracteristicas'),
(1952, 'theme_moove', 'marketing4content', '<ul>\r\n<li>M&oacute;dulos con videos cortos.</li>\r\n<li>8 horas aprox.</li>\r\n<li>Modalidad asincr&oacute;nica.</li>\r\n<li>Actividades interactivas.</li>\r\n<li>Recursos virtuales</li>\r\n</ul>'),
(1953, 'theme_moove', 'numbersfrontpagecontent', '<h2>Con la confianza de m&aacute;s de 25,000 clientes satisfechos.</h2>\r\n<p>Con muchos bloques &uacute;nicos usted puede f&aacute;cilmente construir <br class=\"d-none d-sm-block d-md-none d-xl-block\">una p&aacute;gina sin escribir c&oacute;digo. Construya su pr&oacute;ximo sitio web <br class=\"d-none d-sm-block d-md-none d-xl-block\">en pocos minutos.</p>'),
(1954, 'theme_moove', 'sliderimage1', '/Banner.png'),
(1955, 'theme_moove', 'slidertitle1', 'Capacitaciones por el Centro Nacional de Planeamiento Estratégico'),
(1956, 'theme_moove', 'slidercap1', '<h3>&nbsp;</h3>\r\n<p>&nbsp;</p>'),
