INSERT INTO `mdl_course` (`id`, `category`, `sortorder`, `fullname`, `shortname`, `idnumber`, `summary`, `summaryformat`, `format`, `showgrades`, `newsitems`, `startdate`, `enddate`, `relativedatesmode`, `marker`, `maxbytes`, `legacyfiles`, `showreports`, `visible`, `visibleold`, `downloadcontent`, `groupmode`, `groupmodeforce`, `defaultgroupingid`, `lang`, `calendartype`, `theme`, `timecreated`, `timemodified`, `requested`, `enablecompletion`, `completionnotify`, `cacherev`, `originalcourseid`, `showactivitydates`, `showcompletionconditions`, `pdfexportfont`) VALUES
(1, 0, 1, 'Aula Ceplan', 'Ceplan', '', '', 0, 'site', 1, 3, 0, 0, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1696613466, 1696614973, 0, 0, 0, 1696615952, NULL, 0, NULL, NULL),
(2, 1, 10002, 'Modulo I: Planeamiento estratégico en el SINPLAN ', 'Políticas y planes del Sinaplan', '', '<p class=\"MsoNormal\">Este curso te ense&ntilde;ar&aacute; a analizar el entorno de las instituciones, sectores y territorios, identificando tendencias, potenciales riesgos y oportunidades. Aprender&aacute;s a anticipar escenarios alternativos y eventos disruptivos, evaluando sus impactos y formulando soluciones efectivas. Descubrir&aacute;s c&oacute;mo construir el futuro deseado desde el presente, guiando la planificaci&oacute;n a largo plazo y fomentando la mejora continua. &iexcl;Prep&aacute;rate para desarrollar habilidades prospectivas clave en este curso transformador!<br><o:p></o:p></p>\r\n<p><span style=\"color: rgb(55, 65, 81); font-family: S&ouml;hne, ui-sans-serif, system-ui, -apple-system, \'Segoe UI\', Roboto, Ubuntu, Cantarell, \'Noto Sans\', sans-serif, \'Helvetica Neue\', Arial, \'Apple Color Emoji\', \'Segoe UI Emoji\', \'Segoe UI Symbol\', \'Noto Color Emoji\'; font-size: 16px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: pre-wrap; background-color: rgb(247, 247, 248); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">&nbsp;</span></p>', 1, 'topics', 1, 5, 1697086800, 1728622800, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1697066921, 1697142071, 0, 1, 0, 1697142071, NULL, 1, 1, NULL),
(3, 1, 10003, 'Módulo II. Planeamiento en Políticas Nacionales (Fase 1 y 2)', 'Planeamiento en Políticas Nacionales', '', '<p>Este curso te ense&ntilde;ar&aacute; c&oacute;mo las pol&iacute;ticas nacionales se desarrollan dentro del marco de las pol&iacute;ticas de Estado, respondiendo a las necesidades y problemas prioritarios identificados en la sociedad y la agenda p&uacute;blica. Descubrir&aacute;s c&oacute;mo los ministerios dise&ntilde;an, establecen, ejecutan y supervisan estas pol&iacute;ticas, tanto a nivel nacional como sectorial, influyendo en todos los niveles de gobierno. Aprender&aacute;s a analizar el proceso completo, desde la identificaci&oacute;n de desaf&iacute;os hasta la implementaci&oacute;n efectiva, permiti&eacute;ndote comprender y contribuir significativamente al desarrollo pol&iacute;tico y social del pa&iacute;s.</p>', 1, 'topics', 1, 5, 1697086800, 1728622800, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1697072579, 1697142144, 0, 1, 0, 1697142144, NULL, 1, 1, NULL),
(4, 1, 10004, 'Módulo III. Planeamiento Estratégico Sectorial Multianual (Fase 1 y 2', 'Planeamiento Estratégico Sectorial Multianual ', '', '<p class=\"MsoNormal\" style=\"text-align: left;\"><span><span class=\"ui-provider ec bdw bdx bdy bdz bea beb bec bed bee bef beg beh bei bej bek bel bem ben beo bep beq ber bes bet beu bev bew bex bey bez bfa bfb bfc bfd\" dir=\"ltr\">Este curso te ense&ntilde;ar&aacute; a identificar variables clave, actores importantes y eventos futuros, como tendencias y oportunidades. Aprender&aacute;s a incorporar las aspiraciones de la poblaci&oacute;n y a redactar la imagen deseada del sector en el planeamiento. Al finalizar, ser&aacute;s capaz de determinar variables prioritarias, brechas y actores clave, construir matrices de impacto y proponer medidas anticipatorias basadas en an&aacute;lisis de tendencias, riesgos, oportunidades y escenarios. Adem&aacute;s, conocer&aacute;s la estructura para redactar la imagen deseada del territorio.</span></span><br><o:p></o:p></p>', 1, 'topics', 1, 5, 1697086800, 1728622800, 0, 0, 0, 0, 0, 1, 1, NULL, 0, 0, 0, '', '', '', 1697073015, 1697124609, 0, 1, 0, 1697129977, NULL, 1, 1, NULL),
(5, 1, 10001, 'Módulo IV. Planeamiento para el Desarrollo Concertado (Fase 1 y 2)', 'Planeamiento para el Desarrollo Concertado', '', '<p class=\"MsoNormal\">Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed auctor lectus vel libero commodo. Nulla facilisi. Praesent vel suscipit sem. Cras a justo at risus dictum euismod. Fusce in lorem nec sem placerat bibendum. Nulla facilisis tortor vel metus tincidunt fermentum.<o:p></o:p></p>', 1, 'topics', 1, 5, 1697086800, 1728622800, 0, 0, 0, 0, 0, 0, 0, NULL, 0, 0, 0, '', '', '', 1697073139, 1697073430, 0, 1, 0, 1697078526, NULL, 1, 1, NULL);

