--

INSERT INTO `mdl_page` (`id`, `course`, `name`, `intro`, `introformat`, `content`, `contentformat`, `legacyfiles`, `legacyfileslast`, `display`, `displayoptions`, `revision`, `timemodified`) VALUES
(1, 4, 'Objetivo del curso', '', 1, '<p>el objetivo del curso</p>', 1, 0, NULL, 5, 'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}', 1, 1697125766),
(2, 4, 'Objetivo del Curso', '', 1, '<p style=\"margin-bottom: 16px; margin-top: 0px;\"><strong>Objetivo del curso</strong></p>\r\n<h3 style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">Sobre la capacitaci&oacute;n asincr&oacute;nica</h3>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">Ante un contexto cambiante como el actual, es necesario considerar los posibles cambios a futuro que puedan poner en riesgo o fortalecer el desarrollo del pa&iacute;s, sectores, regiones, provincias y distritos.</p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">La capacitaci&oacute;n tiene por prop&oacute;sito brindar un mayor entendimiento sobre la fase de conocimiento integral de la realidad y la fase de futuro deseado, as&iacute; como fortalecer las habilidades de pensamiento de largo plazo con una perspectiva m&aacute;s amplia de los diferentes futuros posibles. Adem&aacute;s, de mejorar la previsi&oacute;n de eventos de futuro, y, por ende, mayor preparaci&oacute;n ante el futuro.</p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">En este sentido, con la participaci&oacute;n en la capacitaci&oacute;n asincr&oacute;nica, se aprender&aacute; lo siguiente:</p>\r\n<ul>\r\n<li><span style=\"font-size: xx-small;\">Elaborar diagn&oacute;stico y la imagen actual del territorio</span></li>\r\n<li><span style=\"font-size: xx-small;\">Identificar variables prioritarias</span></li>\r\n<li><span style=\"font-size: xx-small;\">Conocer situaci&oacute;n actual</span></li>\r\n<li><span style=\"font-size: xx-small;\">Analizar tendencias, riesgos y oportunidades</span></li>\r\n<li><span style=\"font-size: xx-small;\">Construir escenarios alternativos y escenario normativo</span></li>\r\n<li><span style=\"font-size: xx-small;\">Identificar las aspiraciones de la poblaci&oacute;n</span></li>\r\n<li><span style=\"font-size: xx-small;\">Redactar la imagen deseada del territorio</span></li>\r\n<li><span style=\"font-size: xx-small;\">Utilizar m&eacute;todos y t&eacute;cnicas de prospectiva adecuadamente</span></li>\r\n</ul>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\"><strong>Habilidades a desarrollar: </strong>Pensamiento de largo plazo, pensamiento estrat&eacute;gico, desarrollo de escenarios, creatividad, escucha activa.</p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">&nbsp;</p>\r\n<h3 style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 16px;\">Objetivo de la capacitaci&oacute;n</h3>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">Fortalecer las capacidades y brindar conocimientos actualizados y especializados en prospectiva y proceso desarrollado para el Sinaplan, a fin de lograr mayor efectividad en el conocimiento integral de la realidad y futuro deseado por parte de funcionarios p&uacute;blicos. Entre sus objetivos espec&iacute;ficos se encuentran los siguientes:</p>\r\n<ul>\r\n<li><span style=\"font-size: xx-small;\">Brindar un marco anal&iacute;tico, conceptual e instrumental introductorio que facilite el an&aacute;lisis prospectivo en la elaboraci&oacute;n y actualizaci&oacute;n de la situaci&oacute;n futura en pol&iacute;ticas y planes.</span></li>\r\n<li><span style=\"font-size: xx-small;\">Contribuir al fortalecimiento del proceso de planeamiento estrat&eacute;gico para una mejor gesti&oacute;n en el gobierno, que promueva el desarrollo, en l&iacute;nea con el Plan Estrat&eacute;gico de Desarrollo Nacional 2050.</span></li>\r\n</ul>', 1, 0, NULL, 5, 'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}', 1, 1697127876),
(3, 4, '¡Bienvenido al curso!', '', 1, '<p><span style=\"color: rgb(29, 33, 37); font-family: Roboto; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 0px; text-transform: none; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; white-space: normal; background-color: rgb(255, 255, 255); text-decoration-thickness: initial; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\"><span>&nbsp;</span>&iexcl;Hola! Bienvenido a la capacitaci&oacute;n sobre la formulaci&oacute;n y actualizaci&oacute;n del Plan Estrat&eacute;gico Sectorial Multianual, PESEM, desarrollado por el Ceplan. En este curso te ense&ntilde;aremos a analizar variables prioritarias, a identificar actores clave del sector y reconocer los eventos futuros (como tendencias, riesgos, oportunidades y escenarios) para proponer medidas de anticipaci&oacute;n que permitan reducir la incertidumbre respecto al futuro. Tambi&eacute;n podr&aacute;s incorporar las aspiraciones de la poblaci&oacute;n y determinar la imagen deseada del sector. Al finalizar este curso, podr&aacute;s coordinar la Fase I y Fase II de un Plan Estrat&eacute;gico Sectorial Multianual, PESEM.</span>&nbsp;<video title=\"Bienvenido al curso\" controls=\"true\" width=\"720\" height=\"500\">\r\n        <source src=\"https://youtu.be/O1nRV668qhQ\">\r\n    https://youtu.be/O1nRV668qhQ\r\n</video>&nbsp;</p>\r\n<p><a href=\"@@PLUGINFILE@@/Gu%C3%ADa%2BMetodol%C3%B3gica%2Bpara%2Bel%2BPlaneamiento%2BEstrat%C3%A9gico%2BSectorial%20%281%29.pdf\">@@PLUGINFILE@@/Gu%C3%ADa%2BMetodol%C3%B3gica%2Bpara%2Bel%2BPlaneamiento%2BEstrat%C3%A9gico%2BSectorial%20%281%29.pdf</a></p>\r\n<p>&nbsp;</p>', 1, 0, NULL, 5, 'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}', 2, 1697128257),
(4, 4, 'Planeameinto Estratégico Sectorial', '', 1, '<p style=\"margin-bottom: 16px; margin-top: 0px;\"><strong>Planeamiento Estrat&eacute;gico Sectorial</strong></p>\r\n<h3 style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\"><strong>Fase 1. Conocimiento integral de la realidad y Fase 2. Futuro deseado</strong></h3>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\"><strong>[Resoluci&oacute;n de Presidencia de Consejo Directivo N&deg;009-2023/CEPLAN/PCD]</strong></p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">El proceso para la formulaci&oacute;n o actualizaci&oacute;n de los planes estrat&eacute;gicos sectoriales multianual se enmarca en el ciclo de planeamiento para la mejora continua. Las Etapas 1 y 2 del proceso para la elaboraci&oacute;n de PESEM responden a la interrogante de la FASE 1 del conocimiento integral de la realidad, es decir, son elementos que nos describen &iquest;C&oacute;mo vivimos?; las Etapas 3 y 4 responden la interrogante de la FASE 2 sobre el futuro deseado, &iquest;C&oacute;mo queremos vivir?; y toda esa informaci&oacute;n se desarrolla la FASE 3 de pol&iacute;ticas y planes coordinados, donde se elaboran espec&iacute;ficamente los objetivos y acciones estrat&eacute;gicas sectoriales y sus indicadores.<img class=\"img-fluid align-top\" role=\"presentation\" src=\"@@PLUGINFILE@@/Planeamiento.png\" alt=\"\" width=\"951\" height=\"322\"></p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">Recursos disponibles:&nbsp;</p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\"><a href=\"@@PLUGINFILE@@/Gu%C3%ADa%2BMetodol%C3%B3gica%2Bpara%2Bel%2BPlaneamiento%2BEstrat%C3%A9gico%2BSectorial%20%281%29.pdf\">Guia Metodol&oacute;gica para el Planeamiento Estrat&eacute;gico Sectorial.pdf</a></p>\r\n<p style=\"margin-bottom: 16px; margin-left: 0px; margin-top: 0px;\">&nbsp;</p>', 1, 0, NULL, 5, 'a:2:{s:10:\"printintro\";s:1:\"0\";s:17:\"printlastmodified\";s:1:\"1\";}', 3, 1697129052);

